import { StyleSheet, Text, View } from 'react-native'; 
import React from 'react';
import { FormLabel, Button } from 'react-native-elements';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
        justifyContent: 'space-around',
        alignItems: 'stretch',
        margin: 20
    },
    buttonLogin: {
        backgroundColor: "#32a852",
        width: "100%",
        marginBottom: ""
    },
    buttonRegister: {
        backgroundColor: "#3c4ee8",
        width: "100%"
    }
  });

function HomeView({navigation}) {
    return (
      <View style={styles.container}>
        <Text>Welcome in our app!</Text>
        <Button buttonStyle ={styles.buttonLogin} title="Login"></Button>
        <Button buttonStyle ={styles.buttonRegister} title="Register" onPress={() => navigation.navigate("Register")}></Button>
      </View>
    );
  }
export default HomeView;
